import React, { Component } from 'react';

const jumbotronStyle = {
  paddingBottom: '150px',
  boxShadow: '0px 0px 0px 0px rgba(0,0,0,0)',
  marginTop: 0,
  height: '100vh',
  backgroundColor: '#34c395'
};

class Home extends Component {
  render() {
    return (
      <div className="card-panel lighten-2" style={jumbotronStyle}>
        <div className="container" style={{ color: '#ffffff' }}>
          <h1>{this.props.heading}</h1>
          <p>This is what I built to revise React!</p>
        </div>
      </div>
    );
  }
}

export default Home;
